import React from 'react';

const About = () => {
  return (
    <div className='block'>
      <div className='gap-8 flex shadow- bg-red-900'>
        {/* <div className='absolute border border-white justify-center'>
          <h1 className=' justify-center my-4'>About</h1>
        </div> */}
        <div className='container relative bg-slate-100 w-48 items-start rounded-lg my-10 ml-20 shadow-lg'> 
            <h1 className='text-white text-center font-mono text-4xl m-4'>Members
              <h1 className='p-3 text-amber-200 underline font-mono text-center'><u>150</u></h1>
            </h1>
        </div>
        <div className='container relative bg-slate-100 rounded-lg my-10 mr-20 shadow-lg '>
            <h1 className='absolute text-white text-start text-4xl m-4'>ZETARIOS</h1>
            <p className='p-3 text-amber-200 italic text-center'></p>
        </div>
      </div>
    </div>
  )
}

export default About;
